class Solution:
    def isSubsequence(self, s, t):
        ptr = 0
        n = len(t)
        res = True 

        for i in s:
            res = False

            while (ptr < n):
                if t[ptr] == i:
                    res = True
                    ptr += 1
                    break
                ptr += 1


        return res

if __name__ == '__main__':
    solver = Solution()
    print(solver.isSubsequence("abc", "ahbgdc"))
    print(solver.isSubsequence("axc", "ahbgdc"))
    print(solver.isSubsequence("", "ahbgdc"))
    print(solver.isSubsequence("abc", ""))
    print(solver.isSubsequence("b", "c"))
    print(solver.isSubsequence("leeeeetcode", ""))
